import { link } from "fs";
import { Fragment } from "react";
export default function ListGroup() {
  const items = ["isto", "e", "fixe"];
  if (items.length === 0) {
    <>
      <h1>list</h1>
      <p>empty ._.</p>
    </>;
  }
  return (
    <>
      <h1>bruh</h1>
      <ul className="list-group">
        {items.map((item) => (
          <li key={item}>{item}</li>
        ))}
      </ul>
    </>
  );
}
